import './global.css'
import Header from './components/header'
import Menu from './components/menu'
import FirstArticle from './components/firstArticle'


function App() {
  return (
    <div>


      <Header />

      <Menu />

      <section class="main">

        <FirstArticle />


      </section>

    </div>



  );
}

export default App;
